const DESCANSO_EM_ABERTO = '1';
const DESCANSO_QUITADO = '2';
const TIPO_DESCANSO_FERIAS = '1';
const TIPO_DESCANSO_RECESSO = '4';


// tratar dados de entrata
const validation = com.sydle.util.corp.generalUtilities.validateInput({ 
    inputData: _input, 
    expectedParams: [ 'staffMembersId' ] 
});
if (!validation.isValid) throw validation.message;

const { staffMembersId } = _input;

_output.purchasingPeriods = searchPurchasingPeriod(staffMembersId);

// -----------------------------------------------------------------------------

function searchPurchasingPeriod(staffMembersId) {
    // procurar por periodos de descanso em aberto ou quitados 
    // que possuam saldo programável já existentes
    const purchasingPeriods = ferias.conPeriodosDescansos._search({
        "query": {
            "bool": {
                "must": [
                    {
                        "terms": {
                            "colaboradorId._id": staffMembersId
                        }
                    }
                ],
                "must_not": [
                    {
                        "match": {
                            "quantidadeDiasGozados": 30
                        }
                    },
                    {
                        "exists": {
                            "field": "deactivationDate"
                        }
                    },
                    {
                        "match": {
                            "active": false
                        }
                    }
                ],
                "should": [
                    {
                        "term": {
                            "statusDoPeriodo.externalCode": DESCANSO_EM_ABERTO
                        }
                    },
                    {
                        "term": {
                            "statusDoPeriodo.externalCode": DESCANSO_QUITADO
                        }
                    },
                    {
                        "term": {
                            "tipoDescansoId.externalCode": TIPO_DESCANSO_FERIAS
                        }
                    },
                    {
                        "term": {
                            "tipoDescansoId.externalCode": TIPO_DESCANSO_RECESSO
                        }
                    }
                ],
                "minimum_should_match": 2
            }
        },
        "aggs": {
            "purchasing_periods": {
                "terms": {
                    "field": "colaboradorId._id",
                    "size": 9999
                },
                "aggs": {
                    "purchasing_periods_hits": {
                        "top_hits": {
                            "size": 99,
                            "sort": [
                                {
                                    "dataInicio": {
                                        "order": "asc"
                                    }
                                }
                            ]
                        }
                    }
                }
            }
        },
        "size": 0,
        "from": 0
    }).aggregations.purchasing_periods.buckets.reduce((ppAcc, ppCurVal) => {
        let ppHits = ppCurVal.purchasing_periods_hits.hits.hits;

        ppHits.forEach(pp => {
            pp = pp._source;

            ppAcc[pp.colaboradorId._id] && ppAcc[pp.colaboradorId._id].length ?
                ppAcc[pp.colaboradorId._id].push(pp) :
                ppAcc[pp.colaboradorId._id] = [ pp ];
        });

        return ppAcc;
    }, {});

    // return {
    //     "": [],  --> ID_COLABORADOR: LISTA_DE_PERIODOS_AQUISITIVOS
    // }
    return ( purchasingPeriods && Object.keys(purchasingPeriods).length ) ? purchasingPeriods : null;
}

